text:
i was first acquainted with this brand when i was visiting surat a few weeks back and was exploring the #suratfood scene with my bestie. her being a health freak of sorts, we decided to go to this place and also because my fascination with all things glass. just look at that bottle of theirs! so when i heard they are opening up here, i was very glad! no exaggeration but if you really like sipping something healthy during the day, these people have really nailed it! cause otherwise we do find that if it is "healthy" it won't be tasty. not that these guys add anything to their drinks but the combination of the fruits and vegetables enhances the natural sweetness and that's what has me hooked to this brand! simply fell in love with something as simple as #nimbupani because they do it so well. and they give you so many options to choose from like i am very picky when it comes to fruits but they have em all! and like the other brands, they don't charge you a hefty sum just because "healthy". what more do we want, really!?!
.
.
@thecheffromindia
@thecheffromindia
@thecheffromindia
.
.
